      SELECT DISTINCT col0, col1 + - + CAST ( - col0 AS REAL ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL > + col1 * ( + col1 );
  - name: tab0

outputs:
  - name: q3402.out
    data: |
